import Link from "next/link";
import Typography from "@material-ui/core/Typography";

export default function Sections() {
  return (
    <div className="wrapper">
      <Link href="/sale">
        <a className="item">
          <Typography className="link">Sale</Typography>
        </a>
      </Link>
      <Link href="/sympathy">
        <a className="item">
          <Typography className="link">Sympathy</Typography>
        </a>
      </Link>
      <Link href="/gifts">
        <a className="item">
          <Typography className="link">Gifts</Typography>
        </a>
      </Link>
      <Link href="/plants">
        <a className="item">
          <Typography className="link">Plants</Typography>
        </a>
      </Link>
      <Link href="/birthday">
        <a className="item">
          {" "}
          <Typography className="link">Birthday</Typography>
        </a>
      </Link>
      <Link href="/samedaydelivery">
        <a className="item">
          <Typography className="link">Same Day Delivery</Typography>
        </a>
      </Link>
      <style jsx>{`
        .wrapper: {
            display: flex;
            align-items: flex-start;
            flex-wrap: nowrap;
            height: 100%;
        },
        .item: {
            flexGrow: 1;
        },
        
        .link: {
            color: #8e7329;
        },
      `}</style>
    </div>
  );
}
